import "./Body.css";

  /* Función JavaScript para generar un número aleatorio entre min (incluido) y max (excluido) */
  function random(min, max) {
    return Math.floor(Math.random() * (max - min)) + min;
  }
  
export default function Body() {
  return (
    <body>
      <div class="name-description">
        <h1 class="name">¡Hola! Gracias por entrar, soy Rodrigo VdeV</h1>
        <p class="description">Diseñador UX/UI y desarrollador web front-end</p>
      </div>
    </body>
  );
}
